Object.prototype.objectType = function(){
var obType = String(this.constructor).match(/function\s+(\w+)/);

if(obType) {return obType[1];}
return "undefined"; // just in case...
}

function getTextBetween(object, start, end){
	if(object.objectType()!="String") object=object.innerHTML;
	var index = object.indexOf( start );
	if ( index != -1 ) {
		var mid = object.substring(index+start.length-1);
		index = mid.indexOf( end );
		if ( index != -1 ) {
			mid = mid.substring(1,index);
			return mid;
		}
	}
	return null;
}

function getNewRequest(URI, isSync){
	var req;var reqTimeout;
	req=null;
	
	if(window.XMLHttpRequest){try{req=new XMLHttpRequest();}catch(e){}}else if(window.ActiveXObject){try{req=new ActiveXObject('Msxml2.XMLHTTP');}catch(e){try{req=new ActiveXObject('Microsoft.XMLHTTP');}catch(e){}}}
	try {
		if(req){
				reqTimeout=setTimeout("req.abort();",50000);
				if(isSync==true){
					req.open("GET",URI,false);
					req.send(null);
				}
		}
	}
	catch(error) {
		//alert("Unable to load URL:"+URI);
	}
	return req;
}

function getElementsByProp(parent, tagName, propName, propValue){
	object=parent.getElementsByTagName(tagName);
	var j=0;
	var retArr=new Array();
	for(i=0;i<object.length;i++){
		if(object[i].getAttribute(propName)==propValue){
			retArr[j++]=object[i];
		}
	}
	return retArr;
}

function loadURL(URL, id_placeholder){
	//alert("loading:"+URL);
	var head;var body; var doc;
	
	var req=getNewRequest(URL,true);
	if(req.status==200){
		doc=req.responseText.replace(/<head>/g,"<head1>").replace(/<\/head>/g,"</head1>").replace(/<body/g,"<body1").replace(/<\/body>/g,"</body1>");
		setPlaceholder("hp_doc"+id_placeholder ,doc );
		head=document.getElementsByTagName("head1")[0].innerHTML;
		body=document.getElementsByTagName("body1")[0].innerHTML;
		
		setPlaceholder("hp_head"+id_placeholder ,head);
		setPlaceholder("hp_body"+id_placeholder ,body);
		return true;
	}
	else{alert("Failed fetching, Plz check your netwok connection & try again!"); }
	return false;
}

function clearLoadedData(id_placeholder){
	setPlaceholder("hp_doc"+id_placeholder  ,"");
	setPlaceholder("hp_head"+id_placeholder ,"");
	setPlaceholder("hp_body"+id_placeholder ,"");
}

function showStatus(status,mode){
	if(status=="Loading"){
		switch(mode){
			case "BLOCK":showElement("image_loading");showElement("block_div");break;
			case "BG": showElement("image_loading_bg");break;
			case "BGR": showElement("loading_right");break;
			case "SEARCH": showElement("image_loading_bg1");break;
			default:  break;
		}
	}
	else if(status=="Done"){
		switch(mode){
			case "BLOCK":hideElement("image_loading");hideElement("block_div");break;
			case "BG": hideElement("image_loading_bg");break;
			case "BGR": hideElement("loading_right");break;
			case "SEARCH": hideElement("image_loading_bg1");break;
			default:  break;
		}
	}
}

function delElements(parent, tagName){
	obj=parent.getElementsByTagName(tagName);
	for(i=obj.length-1;i>-1;i--){obj[i].parentNode.removeChild(obj[i]);}
}

function delBetween(object,start,end){
	var rtnVal= new Array();
	rtnVal[0] = getTextBetween(object.innerHTML,start,end);
	text=object.innerHTML.replace(/(\r\n|\n|\r)/gm,"").replace(/(\t)/gm,"");
	var index = text.indexOf( start );
	if ( index != -1 ) {
		var p1 = text.substring(0,index);
		var p2 = text.substring(index + start.length-1);
		index2 = p2.indexOf( end );
		if ( index2 != -1 ) {
			text = p1 + p2.substring(index2+end.length);
			object.innerHTML=text;
			delBetween(object,start,end);
			rtnVal=rtnVal.concat(delBetween(object,start,end));
		}
	}
	return rtnVal;
}

function deleteElement(id){
	var element=document.getElementById(id);
	element.parentNode.removeChild(element);
}
