function fetchDownloadLink(){
		var action=document.getElementById("URLAction").innerHTML;
		var URL=document.getElementById("URLref").innerHTML;
		var valu=readCookie("codeVal");
		if(valu && valu!=""){
			hideElement("captcha_div");
			//showStatus("Loading", "BLOCK");
			var URI=G_qver + escape(valu);
			var req=getNewRequest(URI,true);
			if (req.status == 200) {
				showStatus("Done", "BLOCK");
				var text=req.responseText;
				arr=text.split("#|#");
				text=arr[1];
				if(arr[0]=="Done"){
					actUponURL(text, action);
					return true;
				}
				else{
					G_par=Math.random();
					showCaptcha("ERROR", action);
				}
			}
		}
		else{
			setCookie("codeVal","W",1);
			fetchDownloadLink();
		}
    	return false;
}

function loadURLShortkut(oldURL, action){
	var id=getTextBetween(oldURL,'file=','&song=');
	G_qver='/chk_cd.php?id='+id+'&code=';
	setPlaceholder("URLAction",action);
	setPlaceholder("URLref",oldURL);
	return fetchDownloadLink();
}

function filterPlayer(action, title, id){
	var doc=document.getElementById("hp_doc"+id);
	var scripts=doc.getElementsByTagName("script");
	var mid=null;var flag_exit="FALSE"; var URI="";
	
	
	for (i=0;i<scripts.length ;i++)	{
		//old code for main version
		mid = getTextBetween(scripts[i].innerHTML, ";setTimeout(function(){refresh('", "')}, 1000);}" );
		if ( mid != null ) {
			var URI = mid.replace(/\\/g,"");
			flag_exit="TRUE"
			//break;
		}
		
		//for mobile version
		mid = getTextBetween(scripts[i].innerHTML, "var url='", "';" );
		if ( mid != null && mid.length>7) {
			var URI = mid.replace(/\\/g,"");
			flag_exit="TRUE"
			//break;
		}
	
		mid = getTextBetween(scripts[i].innerHTML, 'qver="', '"+escape(valu.value);' );
		if ( mid != null ) {G_qver=mid;}
		
		mid = getTextBetween(scripts[i].innerHTML, '<img src="code.php?par=', '" id="image_c">');
		if ( mid != null ) {G_par=mid;}
	}
	
	if(!title || title==""){
		var dl_block = getElementsByProp(doc, "div", "class", "download_block")[0];
		title=getElementsByProp(dl_block, "h3", "class", "my_h")[0].innerHTML;
		dl_block = getElementsByProp(dl_block, "table", "class", "bolded")[0].getElementsByTagName("td");
		for(i=0;i<dl_block.length && i<7;i+=2){
			title=title + " > " + dl_block[i].innerHTML + dl_block[i+1].innerHTML;
		}
	}
	clearLoadedData(id);	
	if(flag_exit=='FALSE'){	showCaptcha("NEW", action+title); return false;	}
	else{actUponURL(URI, action+title); return true;}
	
}

function actUponURL(URL, action){
	var act=action.substring(0,2);
	var id=action.substring(2,5);
	var title=action.substring(5,action.length);
	G_pollWait=false;
	switch (act){
		case "sp": showPlayer(URL, title);break;
		case "dl": addLnkToDlList(URL, id, title); break;
		default : alert("unknown action"+action);break;
	}
}

